  const { value, onChange } = props;
  const [form] = Form.useForm();
  const [visible, setVisible] = useState(false);
  const { name = '\u540D\u79F0', section = '\u79D1', family = '\u5C5E' } = value || {};
  const onConfirm = () => {
    form.validateFields().then((values) => {
      onChange(values);
      form.resetFields();
      setVisible(false);
    });
  };

  const extraAction = (
    <Space>
      <Button
        onClick={() => {
          form.resetFields();
          setVisible(false);
        }}
      >
        \u53D6\u6D88
      </Button>
      <Button type="primary" onClick={onConfirm}>
        \u786E\u5B9A
      </Button>
    </Space>
  );

